import React, { useState } from 'react'

const Form = () => {

    const [inp ,setinp] = useState();

    const Submit = e => {
        e.preventDefault()
    }
 
    return (
        <div className='form'>
            <input
            value={inp}
            onChange={(e)=>setinp(e.target.value)}
                className='inp_css'

                type="text"
                placeholder='Add Item'
            />

            <button
            onClick={Submit}
                className='btn_css' >
                Add
            </button>

        </div>
    )
}

export default Form
